from pytube import Searchfrom aiogram import Router, Ffrom aiogram.types import Messagefrom aiogram.filters import CommandStartfrom aiogram.fsm.state import State, StatesGroupfrom aiogram.fsm.context import FSMContextimport app.keyboards as kbrouter = Router()class Photo(StatesGroup):    name = State()class Video(StatesGroup):    name = State()@router.message(CommandStart())async def cmd_start(message: Message):    await message.answer('Привет! Выберите категорию:', reply_markup=kb.main)@router.message(F.text == 'Фото')async def get_photo_name(message: Message, state: FSMContext):    await state.set_state(Photo.name)    await message.answer('Введите название фото:')@router.message(Photo.name)async def push_photo(message: Message, state: FSMContext):    await state.update_data(name=message.text)    try:        await message.answer_photo(photo=f'https://yandex.ru/images/search?text={message.text}')    except:        await message.answer('Фото не найдено')    await state.clear()@router.message(F.text == 'Видео YouTube')async def get_video_name(message: Message, state: FSMContext):    await state.set_state(Video.name)    await message.answer('Введите название видео:')@router.message(Video.name)async def push_video(message: Message, state: FSMContext):    await state.update_data(name=message.text)    query = message.text    s = Search(query)    if not s.results:        await message.reply("Видео не найдено")        return    video = s.results[0]    url = video.watch_url    await message.answer(f'{url}')    await state.clear()